function home(){

	return(
		<div class="home-wrapper flex">
    	<h2 class="flex">Madhavi Ravi</h2>
    	<div class="text">
            I'm a full-stack web developer.
        </div>

         <div class="button page-link" dest="about">
            View my work <i class="mdi mdi-arrow-right"></i>
         </div>
     </div>
	);
}

export default home;
